import React from "react";
import ImgProject2 from "../assets/projects/P2/project2-lineny.png";
import Page1P2 from "../assets/projects/P2/home-screen-mobile-lineny.jpg";
import Page2P2 from "../assets/projects/P2/fund-subway-screen-mobile-lineny.jpg";
import Page3P2 from "../assets/projects/P2/scheduling-screen-mobile-lineny.png";
import Page4P2 from "../assets/projects/P2/account-screen-mobile-lineny.png";
import "../Projects/MediaQueries.css";
const P2 = () => {
    return (
    <div className="project_container">
        <div className="img1">
        <img src={Page1P2} alt="Page P1"/>
        </div>
        <div className="img2">
        <img src={Page2P2} alt="Page P2"/>
        </div>
        <div className="img3">
        <img src={Page3P2} alt="Page P3"/>
        </div>
        <div className="img4">
        <img src={Page4P2} alt="Page P4"/>
        </div>
    </div>
    )
}

export default P2;
